import React, { useState } from 'react';

function UploadForm () {  
  const handleSubmit = () => {
     alert('送信成功');
  };
  
  return (
    <div>
      <div>
        <form onSubmit={handleSubmit}>
          <input type="file" accept=".wav"/>
          <button type="submit">アップロード</button>
        </form>
      </div>
    </div>
  )
  

}

export default UploadForm;
